import random

# Definition for singly-linked list.
class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next
        
        
class Solution:
    def __init__(self, head: Optional[ListNode]):
        self.head = head
        self.n = 0
        while head:
            head = head.next
            self.n += 1
        
    def getRandom(self) -> int:
        n = random.randrange(0, self.n)
        node = self.head
        for _ in range(n):
            node = node.next
        return node.val


